import React from 'react';
import './style.css';

export default function TabPlaceholder() {
  return (
    <div className="tabPlaceholder">
      <div className="tabPlaceholderIcon"></div>

      <div className="tabPlaceholderTitle">Create a borrow pool to get started</div>

      <div className="tabPlaceholderText">In order to get started with borrowing on Sublime, you need to create a borrow pool</div>
    </div>
  );
}
